sys_variable_value.value:
(function execute(inputs, outputs) {
  if (inputs.service_agency == 'DEFENSE_INFORMATION_SYSTEMS_AGENCY') {
    outputs.organization = inputs.disa_organization;
    //convert choice value to its label
    var sysChoice = new GlideRecord('sys_choice');
    sysChoice.addQuery('element', 'disa_organization');
    sysChoice.addQuery('value', inputs.disa_organization);
    sysChoice.query();
    if (sysChoice.next()) {
      outputs.organization = sysChoice.label;
    }
  } else {
    outputs.organization = inputs.non_disa_organization;
  }
})(inputs, outputs);

